query ArtistsTestsQuery {
  show(id: "anderson-fine-art-gallery-flickinger-collection") {
    ...Artists_show
    __id
  }
}

fragment Artists_show on Show {
  artists {
    id
    ...ArtistListItem_artist
    __id
  }
  __id
}

fragment ArtistListItem_artist on Artist {
  id
  __id
  name
  is_followed
  nationality
  birthday
  deathday
  image {
    url
  }
}
